- uid: azure-servicefabric.PagedSubNameInfoList.continuationToken
  name: continuationToken
  fullName: continuationToken
  children: []
  langs:
  - typeScript
  type: property
  summary: >-
    继续标记参数用于获取下一组结果。 从系统的结果无法容纳在单个响应中，则 API 响应中包含继续标记。 当此值传递到下一个 API 调用时，API 返回下一组结果。

    如果没有更多结果，则继续标记在响应中不包括。
  optional: true
  syntax:
    content: 'continuationToken?: string'
    return:
      type:
      - string
  package: azure-servicefabric
